function resetFixtures(){socket.emit("resetFixtures")}function addFixtureModal(){socket.emit("getFixtureProfiles"),$("#fixtureProfilesModal").modal("show")}function addFixture(e){socket.emit("addFixture",{fixtureName:e,startDMXAddress:0}),$("#fixtureProfilesModal").modal("hide")}function openTab(e,t){var i,o,s;for(o=document.getElementsByClassName("tabcontent"),i=0;i<o.length;i++)o[i].style.display="none";for(s=document.getElementsByClassName("tablinks"),i=0;i<s.length;i++)s[i].className=s[i].className.replace(" active","");document.getElementById(t).style.display="block",e.currentTarget.className+=" active"}function titleCase(e){return e.toLowerCase().split(" ").map(function(e){return e.charAt(0).toUpperCase()+e.slice(1)}).join(" ")}var socket=io("http://"+document.domain+":"+location.port);socket.on("fixtures",function(e){console.log(e),0!=e.length&&($("#fixturesList").empty(),e.forEach(function(t,i){$("#fixturesList").append('<div class="col-4"><div class="fixtureItem"><p>'+e[i].shortName+"</p></div></div>")}))}),socket.on("message",function(e){console.log(e.type+": "+e.content)}),socket.on("fixtureProfiles",function(e){$("#fixtureProfilesList").empty(),e.forEach(function(t,i){$("#fixtureProfilesList").append('<li class="list-group-item fixtureProfileItem" onclick="addFixture(\''+e[i]+"')\">"+titleCase(e[i])+"</li>")})});